import React from "react";

export default function SideImage({
  header,
  text,
  className,
  imageLink,
  left,
}) {
  return (
    <div className={className + (left ? "side-image-left" : "side-image-right")}>
      <h2 className="side-image">{header}</h2>
      <p>{text}</p>
      <img src={imageLink} alt="" className="side-image" />
    </div>
  );
}
